const initialState = {
    error: null,
    incidents: incidents,
    selectedIncident: {},
    metrics: [],
    contextSelectorIncidents: []
};

const slice = createSlice({
    name: 'incident',
    initialState,
    reducers: {
        // HAS ERROR
        hasError(state, action) {
            state.error = action.payload;
        },

        getIncidentsSuccess(state, action) {
            state.incidents = action.payload;
        },

        getIncidentByIdSuccess(state, action) {
            state.selectedIncident = action.payload;
        },
    }
});

// Reducer
export default slice.reducer;

// ----------------------------------------------------------------------

export function getIncidents(orgId, token) {
    return async () => {
        try {
            const headers = {
                Authorization: `Bearer ` + token
            };
            const orgid = orgId === '0' || orgId === '' ? '' : orgId;
            const response = await axios.get('/objects/incidents?limit=10&locale=en', { headers });
            dispatch(slice.actions.getIncidentsSuccess(incidents));
        } catch (error) {
            dispatch(slice.actions.getIncidentsSuccess([]));
            dispatch(slice.actions.hasError(error));
        }
    };
}

export function setIncident(incident) {

    dispatch(slice.actions.getIncidentByIdSuccess(incident));

}
export function getIncidentById(id, token) {
    return async () => {
        try {
            const headers = {
                Authorization: `Bearer ` + token
            };

            const response = await axios.get('/objects/incident/' + id, { headers });
            dispatch(slice.actions.getIncidentByIdSuccess(response.data));

        } catch (error) {
            dispatch(slice.actions.hasError(error));
        }
    };

}